    "chemical-optical-and-physical-data-collected-aboard-the-melville-during-cruise-mv1104-in-t",nt"isopen":
    false,nt"url": null,nt"notes": "NODC Accession 0130851 includes chemical,
    optical and physical data collected aboard the MELVILLE during cruise MV1104 in
    the South Pacific Ocean from 2011-03-23 to 2011-04-23. These data include Attenuation/Transmission,
    CONDUCTIVITY, DEPTH - BOTTOM, DEPTH - OBSERVATION, DISSOLVED OXYGEN, HYDROSTATIC
    PRESSURE, SALINITY, WATER TEMPERATURE and surface irradiance. The instruments used
    to collect these data include CTD, PAR Sensor, echo sounder, oxygen meter and transmissometer.
    These data were collected by William Berelson of University of Southern California,
    and by University of California - San Diego; Scripps Institution of Oceanography
    as part of Documenting N2 fixation in N deficient waters of the Eastern Tropical
    South Pacific. The Lamont-Doherty Earth Observatory (LDEO) submitted these data
